    true,nt"url": null,nt"notes": "This atlas presents observations of the
    infra-red (IR) spectrum of a low current Th-Ar hollow cathode lamp with the 2-m
    Fourier transform spectrometer (FTS) at NIST. These observations establish more
    than 2400 lines that are suitable for use as wavelength standards in the range 691
    nm to 5804 nm. The observations were made in collaboration with the European Southern
    Observatory (ESO), in order to provide calibration reference data for new high-resolution
    Echelle spectrographs, such as the Cryogenic High-Resolution IR Echelle Spectrograph
    ([CRIRES]), ESO's new IR spectrograph at the Very Large Telescope in Chile.",nt"license_title":
